// mi primer componente//
const Nav = (props) => {
    return (
        <>
        <div>
           <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/">Home</Link></li>
           </ul>
        </div>
        </>
    );
}

export default Nav;
